import React from 'react';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';

import Navbar from 'react-bootstrap/Navbar'
// import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
// import { LinkContainer } from 'react-router-bootstrap';
// import Button from 'react-bootstrap/Button';
// import ButtonToolbar from 'react-bootstrap/ButtonToolbar';
import Nav from 'react-bootstrap/Nav'
import { Slider } from './components/Slider';
import { Booking } from './components/Pages/Booking';
import './App.css';
// import NavItem from 'react-bootstrap/NavItem';

// const Home = () => <span>Restaurants</span>;
// const Booking = () => <span>Booking system</span>;
// const Users = () => <span>Users</span>;

const App: React.FC = () => {
  return (
    <BrowserRouter>
        <Navbar bg="light" expand="lg">
            <Navbar.Brand href="#restaurants">React-Bootstrap</Navbar.Brand>
            <Nav fill variant="tabs" defaultActiveKey="/">
                <Nav.Item>
                    <Link to="/" className="nav-link">Restaurants</Link>
                </Nav.Item>
                <Nav.Item>
                    <Link to="/booking" className="nav-link">Manager booking system</Link>
                </Nav.Item>
            </Nav>
        </Navbar>
        <Container className="p-3">
            {/* <div> */}
            <Switch>
                <Route path="/">
                    <Slider />
                </Route>
                <Route path="/booking">
                    <Booking />
                </Route>
            </Switch>
            {/* </div> */}
                {/* <ButtonToolbar className="custom-btn-toolbar">
                    <LinkContainer to="/">
                        <Button>Restaurants</Button>
                    </LinkContainer>
                    <LinkContainer to="/about">
                        <Button>About</Button>
                    </LinkContainer>
                    <LinkContainer to="/users">
                        <Button>Users</Button>
                    </LinkContainer>
                </ButtonToolbar> */}
        </Container>
    </BrowserRouter>
  );
};

export default App;
